name:
Farby, fermeže, laky; prípravky proti hrdzi a poškodeniu dreva; farbivá, farby;
tlačiarenské, značkovacie a rytecké atramenty; surové prírodné živice; kovové fólie a
práškové kovy na maľby, dekorácie, tlačoviny alebo výtvarné práce.

Neliečivé kozmetické a toaletné prípravky; neliečivé prípravky na čistenie zubov;
voňavkárske výrobky, esenciálne oleje; bieliace prípravky a pracie prostriedky;
prípravky na čistenie, leštenie, odmasťovanie a brúsenie.

Kovy a ich zliatiny, rudy; kovové stavebné materiály; prenosné kovové stavby;
kovové káble a drôty okrem elektrických; drobný železiarsky tovar; kovové nádoby na
skladovanie alebo prepravu tovarov; trezory.

Chirurgické, lekárske, zubárske a zverolekárske prístroje a nástroje; umelé
končatiny, umelé oči a umelé zuby; ortopedické pomôcky; chirurgické šijacie potreby;
zariadenia na liečbu a starostlivosť o zdravotne postihnuté osoby; masážne prístroje;
prístroje, pomôcky a potreby používané pri starostlivosti o deti; erotické pomôcky,
potreby a prístroje.

Kaučuk, gutaperča, guma, azbest, sľuda (suroviny alebo polotovary) a náhradky
týchto materiálov; plasty a extrudované živice na použitie vo výrobnom procese;
tesniace, výplňové a izolačné materiály; nekovové ohybné rúry a hadice

Nábytok, zrkadlá, rámy na obrazy; nekovové nádoby na skladovanie alebo prepravu
tovarov; kosť, rohovina, veľrybie kostice, perleť (suroviny alebo polotovary); mušle;
sepiolit; jantár.

Domáce a kuchynské potreby a nádoby; kuchynský riad a náradie okrem príborov;
hrebene a špongie; kefy, štetky a štetce okrem štetcov pre výtvarníkov; materiály na
výrobu kief; čistiace potreby; sklo okrem stavebného (surovina alebo polotovar);
výrobky zo skla, porcelánu a keramiky.

Káva, čaj, kakao a kávové náhradky; ryža; tapioka a ságo; múka a obilninové
výrobky; chlieb, pekárske a cukrárske výrobky; zmrzliny; cukor, med, melasový sirup;
droždie, prášky do pečiva; soľ; horčica; ocot, omáčky (chuťové prísady); koreniny;
konzumný ľad.

Vedecké a technologické služby a s nimi súvisiaci výskum a projektovanie;
priemyselné analýzy a priemyselný výskum; navrhovanie a vývoj počítačového
hardvéru a softvéru.

Právne služby; fyzická ochrana osôb a hmotného majetku (bezpečnostné služby);
osobné a sociálne služby poskytované tretími osobami na uspokojovanie potrieb
jednotlivcov.
